import React from 'react';
import DeleteIcon from '@material-ui/icons/Delete';
import Keep from './Keep.module.css';

const Note = () => {
  return (
    <>
      <div className="note">
        <h1>Title</h1>
        <br />
        <p>This is the content</p>
        <button className="btn">
          <DeleteIcon className="deleteIcon" />
        </button>
      </div>
    </>
  );
};

export default Note;
